import React from "react";
import add from "../images/add.png";

const Navbar = () => {
  return (
    <div className="navbar">
      <span className="logo">Lama Chat</span>
      <span className="user">
        <img src="${add}"></img>
      </span>
    </div>
  );
};

export default Navbar;
